    </section>

    <!--====== PAGE BANNER PART ENDS ======-->
    <!--====== ABOUT PART START ======-->

    <section id=""about-page"" class=""pt-70 pb-110"">
        <div class=""container"">
            <div class=""row"">
                <div class=""col-lg-5"">
                    <div class=""section-title mt-50"">
                        <h5>Study Tips</h5>
                        <h3>Study Smarter Not Harder</h3>
                    </div> <!-- section title -->
                    <div class=""about-cont"">
                        <p>Do you ever feel like your study habits simply aren’t cutting it? Do you wonder what you could be doing to perform better in class and on exams? Many students realize that their high school study habits aren’t very effective in college. This is understandable, as college is quite different from high school. The professors are less personally involved, classes are bigger, exams are worth more, reading is more inte");
                WriteLiteral(@"nse, and classes are much more rigorous. That doesn’t mean there’s anything wrong with you; it just means you need to learn some more effective study skills. Fortunately, there are many active, effective study strategies that are shown to be effective in college classes.</p>
                    </div>
                </div> <!-- about cont -->
                <div class=""col-lg-7"">
                    <div class=""about-image mt-50"">
                        <img src=""https://www.daad.org/files/2018/10/Internationale-Studierende-lernen-gemeinsam-in-der-Bibliothek-Copyright-iStockphoto-624x351.jpg"" alt=""About"">
                    </div>  <!-- about imag -->
                </div>
                <div class=""studytips"">
                    <h4 class=""studytipcshd"">1. Study in manageable blocks of time.</h4>
                    <p id=""studytippd"">One of the most common misconceptions is that you need to have long study sessions to cover a vast amount of material. This is actually a hindrance to your bra");
                WriteLiteral(@"in’s ability to retain information. It is better to separate your studying into small, 20-30 minute sessions so that your brain is able to retain a higher percentage of the information presented.</p>
                </div>
                <div class=""studytips"">
                    <h4 class=""studytipcshd"">2. Create a consistent study schedule.</h4>
                    <p id=""studytippd"">
                        In order to help your brain prepare to retain information, try setting up specific times during the week for designated studying. If you have a specific study schedule, your brain will recognize the pattern and become more receptive to new information during these study times. It’s helpful to study within 24 hours of learning new material, as studies show that if a student reviews what they have learned from that day, they are 60% more likely to remember the information.

                        Another recommended time slot for studying would be right before you go to sleep. While you’re sleep");
                WriteLiteral(@"ing, your brain is working to strengthen and retain new memories. Because of this, if you study just before sleep, your brain will readily retain the new information.
                    </p>
                </div>
                <div class=""studytips"">
                    <h4 class=""studytipcshd"">3. Make connections between your various study topics.</h4>
                    <p>If you only memorize a few concepts, but can connect those concepts to your other fields of study, that will help you to access information that you were previously unable to memorize.</p>
                </div>
                <div class=""studytips"">
                    <h4 class=""studytipcshd"">4. Use flashcards rather than just rereading your notes.</h4>
                    <p id=""studytippd"">A common study habit for many is to repeatedly reread their notes and highlight the key points. However, studies show that this is a generally ineffective habit. A better practice is to use flashcards. Why is this? When you continuall");
                WriteLiteral(@"y reread things, you are not challenging your brain to truly understand the concepts. When using flashcards, you are forcing your brain to actually learn about the subject, in order to recall the answer to the prompted question.</p>
                </div>
                <div class=""studytips"">
                    <h4 class=""studytipcshd"">5. Set specific goals for each study session.</h4>
                    <p id=""studytippd"">An easy way to ensure that your shorter study sessions remain concise and effective is to have a specific study goal. Instead of overloading your brain with a large variety of information, it is better to focus on learning a specific concept. This helps to improve retention and confidence in that particular subject. It is also important to reward yourself when you complete these goals! Allow yourself to take a break, spend time with friends or treat yourself to a snack.</p>
                </div>
                <div class=""studytips"">
                    <h4 class=""studytipcshd""");
                WriteLiteral(@">6. Explain the concepts you’re learning out loud.</h4>
                    <p id=""studytippd"">Another way to better understand the topics you’re studying is to teach them to others. Explaining a concept aloud will strengthen your understanding of that concept and your ability to recall the details. While this is a great exercise to do with fellow classmates and friends, you can also teach to an imaginary audience. It doesn’t matter who you explain the material to, as long as you have the ability to explain it.</p>
                </div>
                <div class=""studytips"">
                    <h4 class=""studytipcshd"">7. Test yourself with practice questions.</h4>
                    <p id=""studytippd"">If you are able to find a practice test about the specific concept or test you are studying for, be sure to take advantage of it. Practice tests are a great tool for highlighting which concepts you need to focus on further. Taking practice tests also inspires confidence in the subject of testing. Look f");
                WriteLiteral(@"or practice test sources like Mometrix Academy or Test Prep Review in order to have a successful test day.</p>
                </div>
                <div class=""studytips"">
                    <h4 class=""studytipcshd"">8. Find study environments where you can be productive.</h4>
                    <p id=""studytippd"">In order to help with neural retention, it is beneficial to find your “special” study place. Try to find a quiet space where you can be alone and focus on studying without distractions. Whether it’s the library, a coffee shop, your room or elsewhere, keep track of which locations inspire the most productivity. Once you’ve established these locations as designated study spaces, your brain will register that it’s time to focus and become more receptive to new information.</p>
                </div>
                <div class=""studytips"">
                    <h4 class=""studytipcshd"">9. Don’t listen to distracting music while you study.</h4>
                    <p id=""studytippd"">While music ");
                WriteLiteral(@"can inspire a sense of calm or motivation, it can also be distracting. Although certain types of classical music have been shown to assist your brain with information retention, upbeat music with lyrics can make it more difficult to focus. So if you do choose to listen to music while studying, try to stick to instrumental music.</p>
                </div>
                <div class=""studytips"">
                    <h4 class=""studytipcshd"">10. Put your cell phone away while you study.</h4>
                    <p id=""studytippd"">
                        Of all the distractions students face while trying to study, cell phones are likely the most significant one. While text messages and social media are great forms of communication, they have no place in the study environment. One strategy you can try is setting a timer on your phone, and agreeing not to look at your phone within that set time period. Establish checking your phone as a reward for staying focused, rather than letting it repeatedly divert your");
                WriteLiteral(@" focus away from the material you’re studying.

                        We hope these tips will help you to develop great study habits and ace your upcoming exams! You’ll be amazed by the benefits gained from following these simple techniques. Good luck in all of your academic endeavors!
                    </p>
                </div>
